package jSmugmugBackup.model.queue;

public class TransferQueueException extends Exception
{
	private static final long serialVersionUID = 1L;

	public TransferQueueException(String message)
	{
		super(message);
	}
	
	public TransferQueueException(Throwable cause)
	{
		super(cause);
	}
	
	public TransferQueueException(String message, Throwable cause)
	{
		super(message, cause);
	}
	
}
